import React from "react";
import Button from "./components/nextButton"

const perguntas = [
  {
    pergunta: 'Qual método é utilizado para criar componentes?',
    options: [
      'React.makeComponent()',
      'React.createComponent()',
      'React.createElement()',
    ],
    resposta: 'React.createElement()',
    id: 'p1',
  },
  {
    pergunta: 'Como importamos um componente externo?',
    options: [
      'import Component from "./Component"',
      'require("./Component")',
      'import "./Component"',
    ],
    resposta: 'import Component from "./Component"',
    id: 'p2',
  },
  {
    pergunta: 'Qual hook não é nativo?',
    options: ['useEffect()', 'useFetch()', 'useCallback()'],
    resposta: 'useFetch()',
    id: 'p3',
  },
  {
    pergunta: 'Qual palavra deve ser utilizada para criarmos um hook?',
    options: ['set', 'get', 'use'],
    resposta: 'use',
    id: 'p4',
  },
];


function App() {

  return (
    <>
      {perguntas.map((pergunta) => (
        <><h1>{pergunta.pergunta}</h1><label htmlFor="pergunta">
          <input type="radio" name="" id="pergunta" />{pergunta.options[0]}
          <input type="radio" name="" id="pergunta" />{pergunta.options[1]}
          <input type="radio" name="" id="pergunta" />{pergunta.options[2]}
        </label></>
      ))}
      <Button perguntas={ perguntas }/>
    </>
  );
}

export default App;
